import './App.css';
import { Feed } from './components/Feed';
import { Navbar } from './components/Navbar';
import { Rightbar } from './components/Rightbar';
import { Sidebar } from './components/Sidebar';

function App() {
  return (
  <div sx={{backgroundColor:"cyan"}} >
    <Navbar/>


     <Sidebar/>
     <Rightbar/>
     <Feed>
     <Button>
      Çok Satanlar
     </Button>
     </Feed>
    </div>
  );
}

export default App;
